import React from 'react';
import { Route } from 'react-router-dom';
import './App.css';
import Homepage from './Homepage';
import './NavBar.css'
import { faBars, faWindowClose } from '@fortawesome/free-solid-svg-icons';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';


function openSlideMenu() {
  document.querySelector('.mobile-nav').style.width = '250px';
  document.querySelector('.mobile-nav').style.marginLeft = '250px';
}

function closeSlideMenu() {
  document.querySelector('.mobile-nav').style.width = '0px';
  document.querySelector('.mobile-nav').style.marginLeft = '0px';
}


function App() {
  return (
    <div className="App">
        <ul className="mobile-nav">
        <a href="#" onClick={closeSlideMenu}>
          <FontAwesomeIcon icon={faWindowClose} style={{color: 'black', fontSize: '20px'}}/>
        </a>
        <a href="#">Log In</a>
        <a href="#">Sign Up</a>
        <a href="#">Sign Out</a>
      </ul>

     <Route exact path='/home' render= {(props) => { return <Homepage  {...props}  />}} />

    </div>
  );
}

export default App;
